talent_desc:
Evaluate your web applications for security vulnerabilities with a penetration test.

During a Web App Pentest, we leverage the OWASP project as a foundation to perform full unauthenticated and authenticated testing. We focus on identifying weak points across the entire web application by analyzing and testing inputs and outputs controlled by the user, critical functionalities, the application logic flow, injection attacks, and more. 

The main objectives are:
• Assert the security of the Web App while having a limited impact on the system;
• Identify vulnerabilities that could be exploited by a malicious user;
• Identify attack scenarios and their impact on the company's Information System;
• Propose a remediation plan to increase the overall security level;

Please check below the steps and the requirements for completing your project.

📌 STARTER: Black/Grey testing for low complexity Web App, 25h
📌 STANDARD: Black/Grey testing for medium complexity Web App, 40h
📌 ADVANCED:  Black/Grey testing for high complexity Web App, 75h
     
