In bioinformatics analysis that requires the processing of biological sequences (DNA/RNA sequences, amino acid sequences, etc.), scientists are often faced with an enormous amount of work, as manual processing of files often get labour-intensive. Here is where analysis automation becomes very important; this helps to process all files/samples programmatically, hence significantly reducing the time and effort that is put into the work.

In this project, I will help to process your biological sequences/files. Example processes include, but are not limited to:
Formatting multi-fasta file headers into more convenient names;
Calculating GC content for multiple sequences/genomes;
Translating multiple DNA sequence to protein and/or backtranslating protein to DNA sequences;
Searching for motif/patterns through multiple sequences;
Extracting selected fields/regions from files;
Obtaining reverse complements for multiple sequences;
Annotating multiple sequence files; etc.

Kindly reach out with whatever task you have in mind, either it's listed above or not.
     
