The purpose of this project is to offer daily tests for a week. Depending on the tier you'll select, I'll perform tests every day to ensure that your product has the quality you desire. At the end of each day, I'll send you feedback with:
- Tests executed;
- Devices and browsers tested;
- Identified defects.

This methodology is suitable for several reasons, such as:
- You're about to release a new version and you'll need extra tests before and after it becomes in production;
- You just released a new version into production and you want to make sure that wasn't any undesired change;
- You're seeing unexpected behaviours overtime, where bugs are not 100% reproducible and happen occasionally;
-  You don't have QA working regularly and need to perform tests after a few software changes.

Terms:
- In Basic and Standard packages I'll test one device of your choice.
- I'll not be moving forward with a project that requires credit card use.
- I'm not able to perform tests on Safari or macOS at the moment.
     
